export const Vocabulary = [
  {
    setName: "Animals",
    words: [{ mouse: "мышь" }, { snake: "змея" }, { dog: "собака" }]
  },
  {
    setName: "Plants",
    words: {
      pine: "сосна",
      tulip: "тюльпан",
      daisy: "маргаритка",
      chamomile: "ромашка"
    }
  }
];
